import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import ImageIcon from '@mui/icons-material/Image';
import WorkIcon from '@mui/icons-material/Work';
import BeachAccessIcon from '@mui/icons-material/BeachAccess';
import AssignmentIcon from '@mui/icons-material/Assignment';
import {green} from "@mui/material/colors";
import axios from "axios";
import {useEffect, useState} from "react";
import QuestionItem from "./QuestionItem";

export default function QuestionList() {

    const [questionList, setQuestionList] = useState([]);

    useEffect( async () => {
        const response=await axios.get("https://localhost:44338/api/Questions");
        setQuestionList(prevState => response.data);
        console.log(questionList)
    }, []);


    return (
        <List sx={{width: '100%', maxWidth: 1500, bgcolor: 'background.paper'}}>
            {questionList.map((question, index) => {
                <QuestionItem questionTitle={question.title} postedTime={question.date}/>
            })}

        </List>
    );
}
